                                <button id="contactinfoBtn" className="border-0 bg-dark nav-link" onClick={() => setPageInfo('contactinfo')}>
                                    Contact Us
                                </button>
                            </li>
                            <li className="nav-item m-1">
                                <button id="profileBtn" className="btn border-1 border-secondary rounded-circle bg-secondary" onClick={() => setPageInfo('profile')}>
                                    {/* <img src="FinSyncIcon.png" style={{ height: '25px', width: '25px' }} alt="" /> */}
                                    <i class="bi bi-person-fill text-white"></i>
                                </button>
                            </li>
                            <li className="nav-item m-1">
                                <button className="btn btn-outline-danger" onClick={() => props.logOutUser()}>
                                    Log Out
                                </button>
                            </li>
                        </ul>
                    </div>
                </div>
            </nav>
            {page()}
        </div>
    </>);
}

export default HomePage;
